import React, { Component } from 'react'
import { View, Text, Image,StyleSheet,TextInput} from 'react-native'
import { Button } from 'react-native-elements';
class PetScreen extends Component {
   state = {
      data: ''
   }
   componentDidMount = () => {
    fetch('https://jsonblob.com/api/ef95fdc4-1ab1-11eb-84f5-11ae858035ac',  {
         method: 'GET'
      })
      .then((response) => response.json())
      .then((responseJson) => {
         console.log(responseJson);
         this.setState({
            data: responseJson
         })
      })
      .catch((error) => {
         console.error(error);
      });
   }
   render() {
      return (
         <View style={{backgroundColor:'grey',padding:'30px'}}>
 <Image 
          style={{ width: '200px', height: '100px' ,alignItems:'center',justifyContent:'center'}}
          source={{uri:this.state.data.image}}
        />
            <Text>
             Pet Name : {this.state.data.petName}
            </Text>
            <Text>
              Pet Age : {this.state.data.petAge}
            </Text>
            <Text>
             Pet Location :  {this.state.data.petLocation}
            </Text>
            <Text>
             Pet Breed :  {this.state.data.petBreed}
            </Text>
           <Text>Owner Details : </Text>
         <TextInput style={{
            padding:20,
            height:100,
            margin:10,
            borderWidth:1,
            backgroundColor:'#fff'
         }}></TextInput>
         <View style={{flexDirection:"row"}}><Button style={{width:'130px',height:'35px',backgroundColor:'white'}}
  title="Call to Owner"
/> &nbsp;&nbsp;&nbsp;
<Button style={{width:'100px',height:'35px',backgroundColor:'white'}}
  title="Delete"
/></View>
         </View>
      )
   }
}

export default PetScreen
